import logo from './logo.svg';
import header_img from './header_img.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <div styles={{ backgroundImage:`url(' + require('./header_img.jpg') + ')` }}>
          <h1>LAWrgMiner Project</h1>
        </div>
      </header>
    </div>
  );
}

export default App;
